import React from 'react';
import './contract-card.css';

const ContractCard = (props) => {

    console.log('hello from contract-card, props are:', props);
    const { info, onCardSelected} = props;
    const {id} = info;


    const items = Object.values(info).map((item) => {

      return (
        <div>
           {item}
        </div>
      );
    });

    return (
      <li  onClick={(id) => onCardSelected(id)}>
        {items}
      </li>
    );
  };



export default ContractCard;
